import React from "react";
import Header from "./components/Header";
import PageSetter from "./components/PageSetter";
import Footer from "./components/Footer";

function App() {
  return (
    <div>
      <Header />;
      <PageSetter />;
      <Footer />;
    </div>
  );
}

export default App;

